import React from "react";
import "./Button.css";
import plus from "../Images/plus.png";

function Button() {
  function clickHandler() {
    console.log("I was clicked");
  }
  return (
    <>
    input
      <button className="btn" onClick={clickHandler}>
        <img src={plus} alt="plus" />
      </button>
    </>
  );
}

export default Button;
